import React from 'react';
import { SettingsProvider } from './SettingsContext';
import withTimeTracking from './withTimeTracking';
import MainComponent from './MainComponent';

const TrackedMainComponent = withTimeTracking(MainComponent);

const App = () => {
  return (
    <SettingsProvider>
      <div>
        <h1>Your App</h1>
        <TrackedMainComponent />
      </div>
    </SettingsProvider>
  );
};

export default App;
